// Layer = 784 i cells * 2 * 4 bytes * 10 o cells = +- 62Kbytes
// image_vector  = 784 i cells  * 10 o cells * 4 bytes = +- 31Kbytes
// weight_vector = 784 i cells  * 10 o cells * 4 bytes = +- 31Kbytes
// estimated stack size: 62Kbytes + 31Kbytes + 31Kbytes ~= 128Kbytes

typedef struct Cell Cell;
typedef struct Layer Layer;

struct Cell {
    int input [NUMBER_OF_INPUT_CELLS];
    float weight[NUMBER_OF_INPUT_CELLS];
    float output;
    float bias;
};

struct Layer {
    Cell cell[NUMBER_OF_OUTPUT_CELLS];
};

void setLayerInput (Layer * l, int image[]) {
	int i,j;
	
	for (i = 0; i < NUMBER_OF_OUTPUT_CELLS; i++) {
		for (j = 0; j < NUMBER_OF_INPUT_CELLS; j++) {
			l->cell[i].input[j] = image[j];
		}
	}
}

void setCellWeight (Cell * c, float weight[]) {
	int i;
	
	for (i = 0; i < NUMBER_OF_INPUT_CELLS; i++) {
		c->weight[i] = weight[i];
	}
}

void setCellOutput (Layer * l) {
	int i,j;
		
	for (i = 0; i < NUMBER_OF_OUTPUT_CELLS; i++) {
		l->cell[i].output = 0;
		for (j = 0; j < NUMBER_OF_INPUT_CELLS; j++) {
			l->cell[i].output = l->cell[i].output + (l->cell[i].input[j] * l->cell[i].weight[j]);
		}
		l->cell[i].output = l->cell[i].output / (float)NUMBER_OF_INPUT_CELLS;
	}	
}

